import React, { Component } from 'react';

import HeaderMdetail from "./header";

class Detail extends Component {


    render(){
        let id  = this.props.match.params.id;

        return (
            <div>
                ID : {id}
                <HeaderMdetail />
            </div>        
        );
    }
}

export default Detail;
